import React , {useState, useEffect} from 'react';
import { makeStyles } from '@material-ui/core/styles';
import CheckBoxOutlineBlankIcon from '@material-ui/icons/CheckBoxOutlineBlank';
function Table(){
    const classes = useStyles();
    const [data, setData] = useState(null);
    useEffect(() => {
        const apiUrl = 'https://o53hpo7bf9.execute-api.us-west-2.amazonaws.com/dev/orders';
        fetch(apiUrl, {mode: 'no-cors'})
          .then(res => res.json())
          .then((result) => {
            console.log("RESULT" + result.orders);
            setData(result.orders);
          });
      },[setData]);

return (
    <div className={classes.tableConatiner}>
        {/**First Row*/}
        <div className={classes.row}>
    <CheckBoxOutlineBlankIcon style={{color: '#E5E5E5'}}/>
    <span className={classes.text}>ID Number</span>
    <span className={classes.text}>Name</span>
    <span className={classes.text}>Status</span>
    <span className={classes.text}>Supplier</span>
    <span className={classes.text}>Date</span>
        </div>
        <div><span>{data}</span></div>
    </div>
)
};
const useStyles = makeStyles({
    tableConatiner: {
        marginLeft: 40,
        marginRight: 40,
        backgroundColor: 'white',
        width: '95%',
        height: '80%',
    },
    row: {
        paddingTop:20,
        display: 'flex',
        flexDirection: 'row',
        justifyContent: 'space-around',
    },
    text: {
        color: '#E5E5E5',
    }
 });
 export default Table;
